import React, { useEffect, useState } from "react";
import axios from "axios";
import "../../css/admin/page/AdminOrdersPage.css";

// üëâ TH√äM HEADER
import AdminHeader from "./AdminHeader";

export default function AdminOrdersPage() {
  const [orders, setOrders] = useState([]);

  useEffect(() => {
    loadOrders();
  }, []);

const loadOrders = async () => {
  const token = localStorage.getItem("adminToken");

  try {
    const res = await axios.get("http://localhost:8080/api/orders", {
      headers: { Authorization: `Bearer ${token}` },
    });

    console.log("Orders: ", res.data);
    setOrders(res.data || []);

  } catch (err) {
    console.log("ERR BACKEND =====> ", err.response?.data);
  }
};

  const changeStatus = async (id, status) => {
    const token = localStorage.getItem("adminToken");

    await axios.put(
      `http://localhost:8080/api/orders/${id}/status`,
      { status },
      {
        headers: {
          Authorization: `Bearer ${token}`,
        },
      }
    );

    loadOrders();
  };

  const renderStatus = (s) => {
    switch (s) {
      case "PENDING":
        return "‚è≥ Ch·ªù x√°c nh·∫≠n";
      case "CONFIRMED":
        return "‚úîÔ∏è ƒê√£ x√°c nh·∫≠n";
      case "SHIPPING":
        return "üöö ƒêang giao";
      case "COMPLETED":
        return "üéâ Giao th√†nh c√¥ng";
      case "CANCELLED":
        return "‚ùå ƒê√£ h·ªßy";
      default:
        return s;
    }
  };

  return (
    <>
      {/* HEADER ADMIN */}
      <AdminHeader />

      <div className="admin-orders">
        <h2>Qu·∫£n l√Ω ƒë∆°n h√†ng</h2>

